window.bookSummaryJSON = "<p>Tourmaline Larou lives an idyllic life of learning by day and partying by night. An aspiring poet, her future promises nothing less than brilliance. Then, Vignette Stonemoss walks through the door, and Tourmaline’s world is upended. As she struggles to understand the effect this stranger has on her, Tourmaline and her fellow fae face a looming threat from the human world. War is on the horizon, and their very existence is at stake. And Tourmaline will discover whether love will save her—or destroy her.</p> <p><i>Carnival Row: Tangle in the Dark</i> is set in the world of the Amazon Original series <i>Carnival Row,</i> created by Travis Beacham and René Echevarria. <i>Carnival Row</i> is available only on Amazon Prime Video.&nbsp;</p> <p><b>Note: Carnival Row contains adult material and graphic language. Listener discretion is advised.</b>&nbsp;</p>"; 
